    const categories = ['Dragon ball','One Piece','One puch'];


    return (
        <>
        <p>GifExpertApp</p>
        <h2>GifExpertApp</h2>
        <hr />

        <ol>
            {
                categories.map((category, i) => {
                    return <li>{i}</li>
                })
            }
        </ol>
        </>

    );

}
